svg.script:
   
	var myMapApp = new mapApp(false,undefined);//与tooltip相关
	var obc;//
	var ocls;
	window.onSVGLoad=initLater();
	function initLater() {
     //this timeout is because of the bbox bug in Firefox which prevents to have access to bbox in onload scripts
              window.setTimeout("init()", 2000);
		window.setTimeout("init()",5000);
		window.setTimeout("init()",9000);
    }
	function init() {
		  
	    /* 添加tooltip*/
        //tooltip styles
         var tooltipTextStyles = {"font-family":"Arial,Helvetica","fill":"dimgray","font-size":2000};
         var tooltipRectStyles = {"fill":"white","stroke":"dimgray"};
         myMapApp.initTooltips("toolTip",tooltipTextStyles,tooltipRectStyles,10,20,3);
         //add tooltip to element
		 myMapApp.addTooltip("legend",undefined,true,false,"target","name");
		 myMapApp.addTooltip("zta",undefined,true,false,"target","name");
		
	}

	function Closeleone(){
		 document.getElementById('cir2_1').setAttribute("style", "visibility: hidden");
	     document.getElementById('cir2_2').setAttribute("style", "visibility: hidden");
	     document.getElementById('cir2_5').setAttribute("style", "visibility: hidden");
		 document.getElementById("mapI2").setAttribute("class","fil7 str6");
		 document.getElementById("mapII2").setAttribute("class","fil12 str6");
		 document.getElementById("mapV2").setAttribute("class","fil14 str6");
	
	}
	function closeinfotip(n)
	{
	document.getElementById('infotip'+n).setAttribute("style", "visibility: hidden"); 
	}

	function Closeletwo(n){
	     
		 document.getElementById("cir2_" + n).setAttribute("style", "visibility: visible");
		 if(n==1){
		 document.getElementById("mapI2").setAttribute("class","fil13 str6");}
		 else if (n==2){
		 document.getElementById("mapII2").setAttribute("class","fil10 str6");}
		 else if(n==5){
		 document.getElementById("mapV2").setAttribute("class","fil11 str6");}
	}
	function Hightlight(evt) {
         var object = evt.target;
         var cls = object.id;
		 
         var objectMap = document.getElementById("map"+cls);
		 ocls = objectMap.getAttribute("class") || object.className;
         objectMap.setAttribute("class","fil100");
   }
   function Recover(evt) {
         var object = evt.target;
		 var cls = object.id;
         var objectMap = document.getElementById("map"+cls);
		 objectMap.setAttribute("class",ocls);
	}
	 function Hght(evt,n) {
         var object = evt.target;
         var cls = object.id;
		 for(var i=1;i<9;i++){
         var objectMap = document.getElementById("map"+cls+i);
		 ocls = objectMap.getAttribute("class") || object.className;
         objectMap.setAttribute("class","fil100");
		 }
   }
    function Rver(evt,n) {
        if(document.getElementById("cir2_" + n).style.visibility=="hidden")
        {
         if(n==1){
		 document.getElementById("mapI2").setAttribute("class","fil7 str6");
		 document.getElementById("mapI1").setAttribute("class","fil7 str6");}
		 else if (n==2){
		 document.getElementById("mapII2").setAttribute("class","fil12 str6");
		 document.getElementById("mapII1").setAttribute("class","fil12 str6");}
		 else if(n==5){
		 document.getElementById("mapV2").setAttribute("class","fil14 str6");
		 document.getElementById("mapV1").setAttribute("class","fil14 str6");}
         }
        else{
         if(n==1){
		  document.getElementById("mapI1").setAttribute("class","fil7 str6");
		  document.getElementById("mapI2").setAttribute("class","fil13 str6");}
		 else if (n==2){
		  document.getElementById("mapII1").setAttribute("class","fil12 str6");
		  document.getElementById("mapII2").setAttribute("class","fil10 str6");}
		 else if(n==5){
		 document.getElementById("mapV1").setAttribute("class","fil14 str6");
		 document.getElementById("mapV2").setAttribute("class","fil11 str6");}
	     }
	}
